import React from 'react'
import { useState } from 'react';
import './Body.css';
import Welcome from './Welcome.tsx';
import Overview from './Overview.tsx';

function Body() {
  
  const [displayHelper, setHelperDisplay] = useState<Boolean>();
  return (
    <div className="Body">
      <Welcome displayHelper={{displayHelper : Boolean, setHelperDisplay}}></Welcome>
      <Overview></Overview>
    </div>
  );
}

export default Body;
